	(8480000819284, 'Bacalao al punto de sal', 'https://prod-mercadona.imgix.net/images/95884637672720f7cf0980cd827660e2.jpg?fit=crop&h=600&w=600', 'Bacalao (Gadus morhua) 90%, agua 9,25% y sal 0,75%. Puede contener trazas de crustáceos y moluscos. Puede contener espinas.', 'Desconocida', 0, 0),
