	(8480000861900, 'Pistacho tostado Hacendado 0% sal añadida', 'https://prod-mercadona.imgix.net/images/8315573a948153de37c7bc722bf71dfa.jpg?fit=crop&h=600&w=600', 'PISTACHOS tostados. TRAZAS DE CACAHUETE Y OTROS FRUTOS DE CÁSCARA.', 'Hacendado', 0, 0),
	(8480000862020, 'Pistacho tostado Hacendado con sal', 'https://prod-mercadona.imgix.net/images/9eea7c9e5920aecbcbd7aa91bc4b77f9.jpg?fit=crop&h=600&w=600', 'PISTACHOS y sal. TRAZAS DE CACAHUETE Y OTROS FRUTOS DE CÁSCARA.', 'Hacendado', 0, 0),
	(8480000865977, 'Lasaña a la boloñesa Hacendado ultracongelada', 'https://prod-mercadona.imgix.net/images/23d69c3487aee681deb6e957ecc0b3f6.jpg?fit=crop&h=600&w=600', 'Agua, carnes (17%) de cerdo y vacuno, leche pasteurizada, sémola de trigo, concentrado de tomate, cebolla (5%), quesos (leche pasteurizada, sal, fermentos lácticos, coagulante microbiano, colorante (E-160b(ii)), endurecedor (E-509)), tomate (2%), zumo de tomate,  harina de trigo, aceite de girasol, almidón modificado, zanahoria, bebida espirituosa, gelatina, azúcar, sal, pan rallado (harina de trigo, agua, sal y levadura), clara de huevo en polvo, especias, gluten de trigo. Contiene gluten, huevo, leche. Puede contener trazas de: crustáceos, pescado, soja, mostaza, moluscos.', 'Hacendado', 0, 0),
	(8480000866004, 'Canelones de carne con bechamel Hacendado ultracongelados', 'https://prod-mercadona.imgix.net/images/7a8785b9c26576487b08e5a0e19f141c.jpg?fit=crop&h=600&w=600', 'Agua, leche pasteurizada, carnes (24%) de pollo y cerdo, sémola de trigo, cebolla (6%), quesos (leche pasteurizada, sal, fermentos lácticos, coagulante microbiano, colorante (E-160b(ii)), endurecedor (E-509)), harina de trigo, tomate (2%), aceite de girasol, zumo de tomate, almidón modificado, bebida espirituosa, pan rallado (harina de trigo, agua, sal y levadura), vino de licor, sal, especias, salsa de soja (agua, soja, trigo, sal), clara de huevo en polvo, gluten de trigo. Contiene gluten, huevo, soja, leche. Puede contener trazas de: crustáceos, pescado, mostaza, moluscos.', 'Hacendado', 0, 0),
	(8480000866011, 'Canelones de carne con bechamel Hacendado ultracongelados', 'https://prod-mercadona.imgix.net/images/d0455733d2efd2ae70be5b388a40de0f.jpg?fit=crop&h=600&w=600', 'Carnes (26%) de pollo y cerdo, agua, leche pasteurizada, sémola de trigo, cebolla (7%), queso, harina de trigo, tomate (2%), aceite de girasol, zumo de tomate, bebida espirituosa, almidón modificado, pan rallado (harina de trigo, agua, sal y levadura), vino de licor, sal, especias, salsa de soja (agua, soja, trigo, sal), clara de huevo en polvo, gluten de trigo. Contiene gluten, huevo, soja, leche. Puede contener trazas de: crustáceos, pescado, mostaza, moluscos.', 'Hacendado', 0, 0),
	(8480000867018, 'Cerveza Clásica Steinburg', 'https://prod-mercadona.imgix.net/images/2dd712839797ad61163ce23c3459d4b1.jpg?fit=crop&h=600&w=600', 'Contiene malta de cebada', 'Steinburg', 0, 0),
	(8480000867025, 'Cerveza Clásica Steinburg', 'https://prod-mercadona.imgix.net/images/06f788943946c4dbf1b25ba623a5727e.jpg?fit=crop&h=600&w=600', 'Contiene malta de cebada', 'Steinburg', 0, 0),
	(8480000869050, 'Arroz tres delicias Hacendado ultracongelado', 'https://prod-mercadona.imgix.net/images/0ff4c985f3b6e073bd4065a5132596db.jpg?fit=crop&h=600&w=600', 'Arroz blanco precocido (agua, arroz), tortilla (huevo,  agua, harina de maíz, sal y zumo de limón concentrado), guisante, zanahoria, gamba  (crustáceo) pelada (gamba, agua, sal y corrector de acidez: citratos de  sodio),  jamón cocido (jamón de cerdo,  agua, sal, azúcar, estabilizantes: trifosfatos y carragenanos, antioxidantes:  eritorbato sódico y extracto de romero, aroma, proteína de cerdo, conservador:  nitrito sódico y especias) y aroma (contiene huevo).', 'Hacendado', 0, 0),
	(8710557022777, 'Berberecho al natural XS Hacendado', 'https://prod-mercadona.imgix.net/images/7063cd5dc297be7ae3b97485a2f6ace3.jpg?fit=crop&h=600&w=600', 'Berberechos (Cerastodema Edule), agua, sal, Acidulantes (E330, E331) y Antioxidante (E385)', 'Hacendado', 0, 0),
	(8712000011079, 'Cerveza Heineken', 'https://prod-mercadona.imgix.net/images/5a90d9228eee2559bccb8fb03e710d11.jpg?fit=crop&h=600&w=600', 'Agua, malta de cebada y extracto de lúpulo. Este producto se elabora con malta de cebada. Contiene gluten', 'Heineken', 0, 0),
	(8712566298297, 'Mayonesa Hellmann\'s', 'https://prod-mercadona.imgix.net/images/4deec73aeb723a5c937308721864e880.jpg?fit=crop&h=600&w=600', 'Ingredientes: Aceite de soja (64%), agua, yema de HUEVO, vinagre de vino blanco, azúcar, sal, almidón modificado de maíz, zumo de limón concentrado, antioxidante (E385), extracto de pimentón, colorante (carotenos).', 'Hellmann\'s', 0, 0),
	(8934563207403, 'Noodles de arroz Acecook', 'https://prod-mercadona.imgix.net/images/32f6e051cf0e605b0f2e31dd96abc900.jpg?fit=crop&h=600&w=600', 'Arroz 91,4%, Espesante: E1404, Sal, Emulsionante: (Lecitina de Soja (E322), Carboximetilcelulosa (E466))', 'Acecook', 0, 0),
	(9902000333359, 'Patatas fritas onduladas Hacendado sabor jamón serrano', 'https://prod-mercadona.imgix.net/images/41b35be6c5ee188dfe096fe4de8e0ded.jpg?fit=crop&h=600&w=600', 'Patata, aceite de girasol (33%) y aroma sabor jamón [maltodextrina,sal,aroma,potenciadores del sabor(glutamato monosódico, inosinato disódico y ganilato disódico) y aroma de humo]. Contiene trazas de leche.', 'Hacendado', 0, 0),
